  render() {
    return (
      <WForm onSubmit={this.props.getWeather}>
        <Row>
          <Col>
            <WForm.Control type="text" name="city" placeholder="city..."  />
          </Col>
          <Col>
            <input type="text" name="country" placeholder="country..." />
            {/* <Form.Control placeholder="Last name" /> */}
          </Col>
        </Row>
        <button> Get Weather </button>
      </WForm>
